description:
Human Nature is a 2001 American-French comedy-drama film written by Charlie Kaufman and directed by Michel Gondry. The film stars Tim Robbins, Rhys Ifans, Miranda Otto and Patricia Arquette. It was screened out of competition at the 2001 Cannes Film Festival.

